import { createApp } from 'vue'
import App from './App.vue'

import store from './store'

import { createRouter, createWebHistory } from 'vue-router';
import StartPage from './views/StartPage.vue';
import RegistrationPage from './views/RegistrationPage.vue'
import LauchPage from './views/LauchPage.vue'

const routes = [
    { path: '/', component: App },
    { path: '/startPage', component: StartPage },
    { path: '/registrationPage', component: RegistrationPage },
    { path: '/lauchPage', component: LauchPage }
];

const router = createRouter({
    history: createWebHistory(),
    routes,
});

createApp(App).createApp(StartPage).use(store).use(router).mount('#app')
